import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { NavLink } from 'react-router-dom';
import './index.css';


const Navigation = () => (
<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
          <Navbar.Brand href="#home">Scan Me</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              <ul>
              <li><NavLink exact activeClassName="current" to="/">Home</NavLink></li>
              <li><NavLink exact activeClassName="current" to="/Cart">Cart</NavLink></li>
              <li><NavLink exact activeClassName="current" to="/Scan">Scan</NavLink></li>
              </ul>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
);

const Main = () => (
  <Switch>
    <Route path='/' component={Home}></Route>
    <Route path='/Cart' component={Cart}></Route>
    <Route path='/Scan' component={Scan}></Route>
  </Switch>
);


export default Navigation;
